import React from "react";
import { useNavigate } from "react-router-dom";
function Movie(){
  const navigate=useNavigate();
  return(
    <>
    <div>Order</div>
    <button  onClick={()=> navigate('Booking')}>place order</button>

    </>
  )
}

export default Movie;
